import '../styles/sidemenu.css';
import vertLine from '../media/verticalLine.png';

function SideMenu() {
  return (
    <div className="SideMenu">
      <img src={vertLine} className="vertLine" />
      <img src={vertLine} className="vertLine" />
    </div>
  );
}

export default SideMenu;
